      <h3>SEBASTIEN TILLOUS-BORDE</h3>
      <span>Sébastien TILLOUS-BORDE est né le 29 Avril 1985 et a commencé le rugby au SC Lasseube à 5 ans et demi. Après un déménagement du côté de Monein, il rejoint le SAM en 1993 pour y rester jusqu’en 2001. Avec l’équipe cadets, il remporte le titre de Champion du Béarn Teulière et Champion d’Aquitaine. Il  mutera au FC Oloron (2 ans), puis Biarritz et Castres. En février 2011, il annonce par une vidéo sur son site officiel qu’il jouera au RC Toulon pour la saison 2011-2012. Avec le RCT, il fait le doublé en 2014 en devenant à la fois champion d’Europe et champion de France. En février 2015, il prolonge son contrat avec le club toulonnais pour trois nouvelles saisons. En 2018, il met un terme à sa carrière de joueur et devient entraîneur des arrières du RC Toulon auprès du nouveau manager Patrice Collazo. Sélectionné tout jeune en équipe du Béarn, il connaît sa première sélection internationale en 2003 à Auch contre l’Ecosse. En 2006, avec l’équipe de France des moins de 21 ans il est Champion du Monde contre l’Afrique du Sud. En 2007-2008, Sébastien va connaître ses premières capes avec l’équipe de France en participant au tournoi des six nations. Il comptera finalement 19 sélections entre 2007 et 2015. Ci-dessus Sébastien Tillous-Borde au stade de France</span>
