      <h3>JEAN PIQUE</h3>
      <span>Jean Piqué, né le 14 Octobre 1935 à Pau, a débuté sa carrière de joueur à Monein. Il portera à 18 reprises le maillot tricolore au poste de trois-quart centre. A l’issue de sa carrière internationale, Jean Piqué rejoint l’équipe de Monein, en tant qu’entraîneur – joueur. Durant la première saison 1968-1969, l’équipe atteint la finale du Championnat de France de Fédérale 3. Malheureusement, au début de la rencontre, J. Piqué est littéralement « descendu » et l’équipe continuera la partie à 14 contre 15. Cette agression a sûrement privé le S.A.M du titre National. Par la suite, Jean Piqué connaîtra une carrière remarquable de dirigeant au sein de la Fédération Française et terminera Président du Comité du Béarn.</span>
